import { format } from 'date-fns';
import numeral from 'numeral';
import PropTypes from 'prop-types';
import {
    TableSortLabel, SortDirection,
  Tooltip,
  Divider,
  Box,
  FormControl,
  InputLabel,
  Card,
  Checkbox,
  IconButton,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TablePagination,
  TableRow,
  TableContainer,
  Select,
  MenuItem,
  Typography,
  useTheme,
  CardHeader,
  SelectChangeEvent
} from '@mui/material';

import { DataTableRequest, DataTableResponse, Order, Column } from '../../../../models/table.type';
import DataTable from '../../../../components/DataTables';
//import BulkActions from './BulkActions';

const UsersTable: FC<any> = ({ editHandler }) => {
    const columns: readonly Column[] = [
    {
        id: 'UserName',
        numeric: false,
        disablePadding: true,
        label: 'User Name',
        visible: true,
        searchAble: true
    },
    {
        id: 'PersonName',
        numeric: false,
        disablePadding: false,
        label: 'Person Name',
        visible: true,
        searchAble: true
    },
    {
        id: 'Email',
        numeric: false,
        disablePadding: false,
        label: 'Email',
        visible: true,
        searchAble: true
    },
    {
        id: 'Password',
        numeric: false,
        disablePadding: false,
        label: 'Password',
        visible: true,
        searchAble: false
    },
    {
        id: 'RoleID',
        numeric: true,
        disablePadding: false,
        label: 'Role',
        visible: false,
        searchAble: false
    },
    {
        id: 'RoleName',
        numeric: false,
        disablePadding: false,
        label: 'Role',
        visible: true,
        searchAble: true
    },
];
  
  return (
    <Card>
           
          <Divider />
          <DataTable editHandler={editHandler } columns={columns} url='user/GetUsers' isSearchAble={ true} />
      </Card>

  );
};

